import React from 'react'
import Card from '../Card/Card'
import './featureproducts.scss'
import { Link } from 'react-router-dom'


const FeatureProducts = ({ type }) => {
    const data = [{
        id: 1,
        img: 'https://cdn.shopify.com/s/files/1/0341/4805/7228/products/ad3698e6-c721-4229-ad85-08bc876934631638773999857-Libas-Women-Kurtas-251638773999266-5_1800x1800.jpg?v=1668675977',
        title: 'Kurtas',
        price: 500,
        disc: ''
    },
    {
        id: 2,
        img: 'https://images.bewakoof.com/t1080/desert-beige-casual-cotton-trouser-330853-1663661915-1.jpg',
        title: 'Pants',
        price: 700,
        disc: ''
    },
    {
        id: 3,
        img: 'https://images.bestsellerclothing.in/data/vero-moda/dec-03-2022/104454301_g0.jpg?width=488&height=650&mode=fill&fill=blur&format=auto&dpr=1.2',
        title: 'Coats',
        price: 1500,
        disc: ''
    },
    {
        id: 4,
        img: 'https://assets.ajio.com/medias/sys_master/root/20221107/WBVg/6369237ef997ddfdbd5d0a6c/-473Wx593H-465244328-olive-MODEL.jpg',
        title: 'Jacktes',
        price: 2200,
        disc: ''
    }]


    return (
        <div className='featureproducts'>
            <div className="top">
                <h1>{type} Products</h1>
                <p>Lorem ipsum dolor sit, amet consectetur adipisicing elit.Lorem ipsum dolor sit, amet consectetur adipisici Assumenda quibusdam iure consectetur totam perspiciatis dolorem facilis est provident eum nemo.</p>
            </div>
            <div className="bottom">
                {data.map((item) => {
                    return <>
                        <Link to={`/product/${item.id}`} key={item.id}><Card item={item} /></Link>
                    </>
                })}

            </div>
        </div>
    )
}

export default FeatureProducts
